import React from "react";

function TicketInfo(props) {
  return (
    <div class="ticket_info">
      <p>Playboi Carti</p>
      <div class="buttons">
        <button>Cancel</button>
      </div>
      <p>{props.date}</p>
      <p>{props.tickid}</p>
    </div>
  );
}

export default TicketInfo;
